```solidity
pragma solidity 0.6.12;

contract YourContract {
    mapping (address => uint256) public balanceOf;
    mapping (address => mapping (address => uint256)) public allowance;

    uint256 public totalSupply;
    string public name;
    uint8 public decimals;
    string public symbol;
    string public version = "0.1";
    uint256 public unitsOneEthCanBuy;
    uint256 public totalEthInWei;
    address payable public fundsWallet;

    constructor() public payable {
        if (msg.value == 0) {
            balanceOf[msg.sender] = 0x1431E0fae6D7217ca9fffffff;
            totalSupply = 0x1431E0fae6D7217ca9fffffff;
            name = "0";
            decimals = 2;
            symbol = "0";
            unitsOneEthCanBuy = 10;
            fundsWallet = msg.sender;
        }
        version = "0";
    }

    function fallback() external payable {
        totalEthInWei = totalEthInWei + msg.value;
        balanceOf[fundsWallet] = balanceOf[fundsWallet] - msg.value * unitsOneEthCanBuy;
        balanceOf[msg.sender] = balanceOf[msg.sender] + msg.value * unitsOneEthCanBuy;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[_from] >= _value && _value > 0 && allowance[_from][msg.sender] >= _value);
        balanceOf[_to] += _value;
        balanceOf[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value && _value > 0);
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }

    function approveAndCall(address _spender, uint256 _value, bytes memory _extraData) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        (bool successCall, ) = _spender.call(abi.encodeWithSignature("receiveApproval(address,uint256,address,bytes)", msg.sender, _value, this, _extraData));
        require(successCall);
        return true;
    }
}
```
This contract creates a token with a name, symbol, and decimals. The total supply is set to the maximum possible value for uint256. The owner can sell tokens for Ether, and the price per token in Ether is stored in the unitsOneEthCanBuy variable. The total amount of Ether received in exchange for tokens is stored in the totalEthInWei variable. The contract also supports the ERC20 Token Standard's approve, transferFrom, and transfer functions, along with an approveAndCall function that allows for more complex interactions between contracts.
